import React from 'react'
import styled from 'styled-components'

const MainContainer = styled.div`
background: ${props => props.theme.text};
width:100vw;
height:100vh;
`

const Main = () => {
  return (
    <MainContainer>
        Main Componenet Page
    </MainContainer>
  )
}

export default Main
